import React, { useEffect, useState } from "react";
import { Card, CardContent, CardHeader } from "../src/components/ui/card";
import { Bar } from "react-chartjs-2";
import { Chart, CategoryScale, LinearScale, BarElement } from "chart.js";
import { Table, TableHead, TableRow, TableCell, TableBody } from "../src/components/ui/table";

Chart.register(CategoryScale, LinearScale, BarElement);

export default function Dashboard() {
  const [stats, setStats] = useState(null);
  const [inventory, setInventory] = useState([]);
  const [transactions, setTransactions] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  // Load initial data
  useEffect(() => {
    const initializeData = async () => {
      try {
        // Check and load sample data
        const inventoryRes = await fetch("http://localhost:8000/inventory");
        if ((await inventoryRes.json()).length === 0) {
          await fetch("http://localhost:8000/inventory/load-online-retail", {
            method: "POST",
          });
        }

        // Fetch all data
        const [statsRes, invRes, transRes] = await Promise.all([
          fetch("http://localhost:8000/dashboard/stats"),
          fetch("http://localhost:8000/inventory"),
          fetch("http://localhost:8000/transactions"),
        ]);

        setStats(await statsRes.json());
        setInventory(await invRes.json());
        setTransactions(await transRes.json());

      } catch (err) {
        setError(err.message);
      } finally {
        setLoading(false);
      }
    };

    initializeData();
  }, []);

  // Chart configuration
  const chartData = {
    labels: ["Products", "Transactions", "Low Stock"],
    datasets: [
      {
        label: "Inventory Overview",
        data: [
          stats?.total_products,
          stats?.total_transactions,
          stats?.low_stock,
        ],
        backgroundColor: ["#3B82F6", "#10B981", "#EF4444"],
      },
    ],
  };

  if (loading) return <div className="p-4">Loading dashboard data...</div>;
  if (error) return <div className="p-4 text-red-500">Error: {error}</div>;

  return (
    <div className="p-6 space-y-8">
      {/* Statistics Cards */}
      <div className="grid grid-cols-3 gap-6">
        <Card>
          <CardHeader className="text-lg font-semibold">Total Products</CardHeader>
          <CardContent>{stats?.total_products}</CardContent>
        </Card>
        <Card>
          <CardHeader className="text-lg font-semibold">Total Transactions</CardHeader>
          <CardContent>{stats?.total_transactions}</CardContent>
        </Card>
        <Card>
          <CardHeader className="text-lg font-semibold">Low Stock Items</CardHeader>
          <CardContent>{stats?.low_stock}</CardContent>
        </Card>
      </div>

      {/* Inventory Chart */}
      <Card>
        <CardHeader className="text-lg font-semibold">Inventory Overview</CardHeader>
        <CardContent>
          <Bar data={chartData} />
        </CardContent>
      </Card>

      {/* Inventory Table */}
      <Card>
        <CardHeader className="text-lg font-semibold">Inventory List</CardHeader>
        <CardContent>
          <Table>
            <TableHead>
              <TableRow>
                <TableCell>Product Code</TableCell>
                <TableCell>Name</TableCell>
                <TableCell>Category</TableCell>
                <TableCell>Quantity</TableCell>
                <TableCell>Price</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {inventory.map((item) => (
                <TableRow key={item.id}>
                  <TableCell>{item.product_code}</TableCell>
                  <TableCell>{item.name}</TableCell>
                  <TableCell>{item.category}</TableCell>
                  <TableCell>{item.quantity}</TableCell>
                  <TableCell>${item.price.toFixed(2)}</TableCell>
                </TableRow>
              ))}
            </TableBody>
          </Table>
        </CardContent>
      </Card>

      {/* Transactions Table */}
      <Card>
        <CardHeader className="text-lg font-semibold">Recent Transactions</CardHeader>
        <CardContent>
          <Table>
            <TableHead>
              <TableRow>
                <TableCell>Product Code</TableCell>
                <TableCell>Change</TableCell>
                <TableCell>Type</TableCell>
                <TableCell>Timestamp</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {transactions.map((trans) => (
                <TableRow key={trans.id}>
                  <TableCell>{trans.product_code}</TableCell>
                  <TableCell>{trans.change}</TableCell>
                  <TableCell>{trans.transaction_type}</TableCell>
                  <TableCell>
                    {new Date(trans.timestamp).toLocaleString()}
                  </TableCell>
                </TableRow>
              ))}
            </TableBody>
          </Table>
        </CardContent>
      </Card>
    </div>
  );
}
